import React from "react";
import { useSelector } from "react-redux";
import { useNavigate, useSearchParams, useParams, Navigate } from "react-router-dom";
import MyButton from "../components/MyButton";
import MyHeader from "../components/MyHeader";

const Edit = () => {
    const { id } = useParams();
    const getData = useSelector((it) => it.write.writeList[id]);
    return (
        <>
            <MyHeader headText={`그 날의 기록`} leftChild={<MyButton onClick={() => Navigate(-1)} text={"뒤로가기"} />} rightChild={<MyButton text={"수정하기"} />} />
        </>
    );
};

export default Edit;
